import networkx as nx
def Regular(n):
    G = nx.path_graph(n)
    G.add_edge(n - 1, 0)
    return G


def sparse(n):
    G=nx.Graph()
    nodes=range(1,n)
    G.add_edges_from([(0,x) for x in nodes])
    return G
